$(document).ready(function(){				   
  $('#logB').click(function(e) { 							  
     $("#loaders").show();	
    $.ajax({
    type: qttps.a,
	url:  qttps.b,
	data: $('#formUserAuth').serialize(),	
	success: function(xhtR){
	var st   = xhtR;
	var temp = new Array();
	temp     =  st.split(':');
	if(temp[0]==="400"){
	  alert(temp[1]);
    }else if(temp[0]==="200"){
	  window.location=temp[1]; 
	}else{
	  $("#appConteiners").html(xhtR);
	}
	  $("#loaders").hide();	
	}
    });
    return false;
  });
});



						